import React, { Component } from 'react';
import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import {
  Button, Popover, PopoverHeader, PopoverBody, Container, Row, Col
      } from 'reactstrap';

import QR from './images/cardQR.png';
import FadedHeader from './FadedHeader.js';
import typewriter from './images/typewriter.jpeg';
import Social from './images/social.png';
import Email from './images/email.png';
import Barcode from './images/barcode.png';
import Accordion from 'react-bootstrap/Accordion';
import Card from 'react-bootstrap/Card';

export default class Contact extends Component  {



  render() {
      return (

        <div>
        <h1 className="contactStyle">Get In Touch</h1>

        <Row>
          <Col className="center">
            <Row>

              <img className="center"
                src={Barcode}
                height = "50%"
                width = "50%"

              />
            </Row>

          </Col>
          <Col className="center">
            <img className="center"
              src={Email}
              height = "50%"
              width = "50%"

            />
          </Col>
          <Col className="center">


            <img className="center"
              src={Social}
              height = "50%"
              width = "50%"

            />

          </Col>
        </Row>

        <Row>
          <Col className="center">
            <img
              src={QR}
              height = "75%"
              width = "50%"

            />
          </Col>
          <Col className="center">
          <a rel="noopener noreferrer"
              className="link hover-silver near-black dib mh3 tc" href="mailto:scott.lau.stubbs@gmail.com" title="Mail">
              <svg className="dib h2 w2" fill="currentColor" xmlns="http://www.w3.org/2000/svg" viewBox="0 0 24 24" fillRule="evenodd" clipRule="evenodd" strokeLinejoin="round" strokeMiterlimit="1.414"><path d="M5.564 2.703l3.45 3.734-2.434 4.798 5.14-.921 2.34 5.646L24 2.926 5.564 2.703zm-.636 8.088l.957-.787-1.234.39-.126-.18.51-.495-.669.27C1.813 10.979 0 13.455 0 16.35c0 1.951.822 3.705 2.133 4.947-.563-.99-.885-2.134-.885-3.355 0-2.865 1.809-5.415 4.315-6.42l.315-.766-.75.331-.211-.285.011-.011zm4.364-1.97L10.89 6l9.398-2.201L9.292 8.821z"/></svg>
              <span className="f6 db">Email</span>
          </a>
          </Col>
          <Col className="center">
            <h1>Github </h1>
            <h1>LinkedIn </h1>
          </Col>
        </Row>



        </div>
      );
  }
}
